    "content": "Friend’s Central CID Documentation Website Welcome! Welcome to the CID, Friends Central’s newest space, built for (insert propaganda here)\nLook through the side menu for different machine guides, use the search bar to find specific sections or continue on this page for an introduction to the website\nWhat is this place? This is the official CID tool documentation webstie, cataloging many of the tools found in the different areas of the CID. If you are new to the CID these guides can help you learn the basic functionality of these tools and give you simple projects to build your understanding.\nThis is bold text, and this is emphasized text.\nH1 H2 H3 blockquote\nfirst second third a b c ‘code’\nstuff other stuff word other word ’’' { code=“code” code=“still code” } ’''\nFootnote. 1\nterm definition strikethrough\ntask 1 task 2 emoji :joy:\n==highlight==\nsub~script~\nsuper^script^\nfootnote ↩︎",
    "description": "Friend’s Central CID Documentation Website Welcome! Welcome to the CID, Friends Central’s newest space, built for (insert propaganda here)\nLook through the side menu for different machine guides, use the search bar to find specific sections or continue on this page for an introduction to the website\nWhat is this place? This is the official CID tool documentation webstie, cataloging many of the tools found in the different areas of the CID.",
