    "content": " Once you have your object oriented as desired, move to the print settings menu.\nThere you will see lots of options, which I will briefly review here\nImage\nProfiles Firstly you will see a list of Profiles. These are the easiest way to select your settings.\nBalanced strikes a balance of productivity, quality, strenth, and accuracy. Use this for general projects.\nVisual prioritizes the outwards appearance to optimize visual properties. Use this for projects that need to look good.\nEngneering prioritizes accurate tolerances, and mechanical strength. Use this for projects will moving parts or that need to be stonger.\nDraft is for models that are prototypes or not particularly valuable. Use this for testing and quick prints.\nResolution Resolution will change the thickness of every layer. The bigger each layer is the faster the model will print, but the worse it will look and function. It’s recoomneded to use Fine for good visual quality or Fast for speed and basic functionality.\nBelow it may say “Reccommended settings for _____ were altered”. Clicking the rewind icon will reset to reccomended settings and the floppy disk icon will save the current settings as a new preset.\nStrength Infill Density This slider will allow you to dictate how much of the interior of the print is filled in, with 0 meaning no fill, and 100 meaning completely full\nimage\nanything down to 10% will be self supporting enough, although 20% is reccomended for nearly every print. 70% is the absolute maximum you need to go for a high strength print, however this should only be used if extreme strength is needed.\nInfill pattern This allows for a selection of how the infill will be created, and the options are shown below:\nGrid Lines Triangles Trihexagon Cubic Cubic Subdivision Octet Quarter Cubic Concentric Zig Zag Cross Cross 3d Gyroid Lightning\n__ is the reccomended setting but this choice has little effect on the overall print.\nShell thickness This lets you set the thickness of the outer shells of the print, with the first box designating the side walls, and the second designating the top and bottom\nSupport Supports are how the printer helps overhangs print, as the printer must always work from bottom to top and cannot print without a surface to print on. Support can be selected and deselected, but is reccomended to use whenever there are overhangs or floating objects in your print\nSupport type This box allows for two choices, Normal and Tree\nNormal creates sheets of support under your print, connected at top and bottom:\nimage\nTree creates branching circular structures to support overhangs in the model:\nimage\nNormal is the reccomended setting unless it creates particularly hard to remove sections with print trapped between support on all sides\nPlacement Placement designates where supports generate, and gives two options, Everywhere and Touching Buildplate\nEverywhere means any overhang will be supported, no matter where on the print it is.\nTouching Buildplate will only support overhangs over the buildplate, and overhangs that have other bits of object below will not generate support\nIt is reccomended to use Everywhere when overhangs are present.\nAdhesion Adhesion helps prints stick to the print bed and avoid shifting and warping off of the bed. It is reccomended to keep this setting selected for any print.\nCustom settings Many other specific settings can be tuned by clicking Show Custom however there are far too many to cover in this guide, so look to a more specific guide on the Cura Slicer for information on that\nDone? Once you have your preferred settings set, move to the slicing files section",
